import React from 'react';
import { View, Text } from 'react-native'; 

const Header = props => (
    <View style={containerStyle}>
        <Text style={titleStyle}>Lista de Contatos</Text>
    </View>
);

const style = {
    container:{
        marginTop: 0,
        backgroundColor: '#ff550f',

        alignItems: 'center',
        justifyContent: 'center'
    }
}

export default Header;
